t atteindre jusqu\'à 100% lors du transfert d\'un montant de 480$ et plus...','Every transfer in the BFS purchase account, amounting to $50 or more, automatically enables you to benefit from a percentage in the discount account,  reaching up to 100% when transferring an amount of $480 and more...'),(1470,'Amount_pay','مبلغ الشراء','Montant d\'achat','Purchase amount'),(1471,'date_purchase','تاريخ الشراء','Date de l\'achat','Date purchase'),(1472,'share_price','سعر بيع الأسهم','Prix de vente actions','Shares selling price '),(1473,'mobile','رقم الهاتف	','Numéro de téléphone','Mobile Number'),(1474,'number_of_shares','عدد الاسهم','Nombre d\'actions','Number of Shares'),(1475,'gifted_shares','أسهم مهداة','Actions offertes','Gifted shares'),(1476,'average_price','متوسط ​​السعر','Prix ​​moyen','Average price'),(1477,'total_price','المجموع المدفوع','Total payé','Total Paid'),(1478,'enFirstName','الاسم','Prénom','First Name'),(1479,'enLastName','اللقب','Nom','Last name'),(1480,'countrie','البلد','Pays','Countrie'),(1481,'FirstName','الاسم','Prénom','First Name'),(1482,'LastName','اللقب','Nom','Last name'),(1483,'pays','البلد','Pays','Countrie'),(1484,'created at','التاريخ','Date','Date'),(1485,'total_shares','إجمالي الأسهم','Total des actions','Total shares'),(1486,'sell_price_now','سعر البيع الحالي','Prix ​​de vente actuel','Current selling price'),(1487,'gains','الأرباح','Gains','Earnings'),(1488,'Real_Sold','بيع حقيقي','Réel Vendu','Real Sold'),(1489,'Real_Sold_amount','المبلغ الحقيقي المباع','Montant réel vendu','Real Sold amount'),(1490,'otp','الرمز السري	','Code OTP','OTP Code'),(1491,'heure_purchase','ساعة الشراء','Heure de l\'achat','Hour of purchase'),(1492,'present_value','القيمة الحالية','Valeur actuelle','Present value'),(1493,'current_earnings','الأرباح الحاليه','Gains actuels','Current earnings'),(1494,'SoldeCB','النقد ($)','Cash ($)','Cash ($)'),(1495,'SoldeBFS','التسوّق ($)','BFS ($)','BFS ($)'),(1496,'SoldeDB','التخفيضات ($)','Remises ($)','Discount ($)'),